import React, { useState, useEffect } from "react";
import axios from "axios";
import "./Profile.css";

function UserCompanyRelationForm() {
    const [data, setData] = useState([]);
    const [newEntry, setNewEntry] = useState({
        companyName: "",
        status: "",
        nextDeadline: "",
        links: "",
    });

    // Fetch initial data
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:3000/api/profile');
                if (response.data && response.data.userCompanies) {
                    setData(response.data.userCompanies);
                }
            } catch (error) {
                console.error("Error fetching data: ", error);
            }
        };
        fetchData();
    }, []);

    const handleInputChange = (event) => {
        setNewEntry({ ...newEntry, [event.target.name]: event.target.value });
    };

    const handleSubmit = async (event) => {
        event.preventDefault();
        await axios.post("http://localhost:3000/api/addCompanyRow", newEntry);
        setData([...data, newEntry]);
        setNewEntry({
            companyName: "",
            status: "",
            nextDeadline: "",
            links: "",
        });
    };

    return (
        <div role="button" tabIndex={0} className="profile" onClick={onClick}>
            <div className="profile__container">
                <h1 className="profile__title">Profile</h1>
                <div className="profile__form">
                    <form onSubmit={handleSubmit}>
                        <div className="profile__form__input">
                            <input
                                type="text"
                                name="companyName"
                                value={newEntry.companyName}
                                onChange={handleInputChange}
                            />
                        </div>
                        <div className="profile__form__input">
                            <select
                                name="status"
                                value={newEntry.status}
                                onChange={handleInputChange}
                            >
                                <option value="Applied">Applied</option>
                                <option value="Interviewing">Interviewing</option>
                                <option value="Offer">Offer</option>
                                <option value="Rejected">Rejected</option>
                            </select>
                        </div>
                        <div className="profile__form__input">
                            <input
                                type="date"
                                name="nextDeadline"
                                value={newEntry.nextDeadline}
                                onChange={handleInputChange}
                            />
                        </div>
                        <div className="profile__form__input">
                            <input
                                type="text" 
                                name="links"
                                value={newEntry.links}
                                onChange={handleInputChange}
                            />
                        </div>
                        <button type="submit">Submit</button>
                    </form>
                </div>
                <div className="profile__table">
                    <table>
                        <thead>
                            <tr>
                                <th>Company Name</th>
                                <th>Status</th>
                                <th>Next Deadline</th>
                                <th>Links</th>
                            </tr>
                        </thead>
                        <tbody>
                            {data.map((row) => (
                                <tr key={row.id}>
                                    <td>{row.companyName}</td>
                                    <td>{row.status}</td>
                                    <td>{row.nextDeadline}</td>
                                    <td>{row.links}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>

    );
}

export default UserCompanyRelationForm;
